$(document).ready(function(){$(".nav-item").mouseover(function(){if(window.screen.width>=991){var a=this;$(".nav-item").each(function(b,c){if(c!==a){$(c).removeClass("show");$(c).find(".dropdown-menu").removeClass("show");$(c).find(".nav-link.dropdown-toggle").attr("aria-expanded",false)}});$(this).find(".nav-link.dropdown-toggle").attr("aria-expanded",true)}});$(".nav-link.dropdown-toggle").click(function(a){if(window.screen.width>=991&&this.href!==""){location.href=this.href}});$(".navbar-toggler[data-target='#navbarSupportedContent']").click(function(b){var a=$(this).data("target");if(!$(a).hasClass("show")){$("#filter-overlay").addClass("show")}else{$("#filter-overlay").removeClass("show")}});$("#filter-overlay").click(function(){$(".navbar-collapse .navbar-toggler[data-target='#navbarSupportedContent']").trigger("click")});$(".mangas .manga").mouseover(function(){var a=$(this).find(".containerImg").find("img, object");var b=$(this).closest(".manga");if($(a).width()>$(b).width()+100){$(this).find(".containerImg").addClass("doubleZoom")}})});